Step-by-step reasoning:
1. Key psychological mechanisms: Responder behavior is driven by (a) self-interest (monetary gain from the offer) and (b) fairness comparisons. Each participant has an expected “fair share” computed from their relative contributions (tokens) compared to the total tokens for the dyad. When the offered split (split_self) falls short of this normative fair share, a fairness “penalty” is incurred.
2. Mechanism interaction: The utility of accepting an offer is modeled as a balance between the monetary gain (split_self) and a penalty for unfair treatment if the offer is lower than what the participant would expect based upon their token contribution. This “norm” (fair_share) is calculated using token_self, token_opp, and combined_earning.
3. Mathematical form: We compute fair_share = (token_self / (token_self + token_opp)) × combined_earning. Then, a shortfall (if any) is defined as max(fair_share – split_self, 0). The overall utility is given by U_accept = split_self – beta × shortfall.
4. Parameter calibration: There is one learnable parameter – beta – that quantifies the sensitivity to deviations from fairness. A higher beta means a greater disutility (penalty) for offers below fair share.
5. Mapping to observable behavior: The observable variables (split_self, token_self, token_opp, and combined_earning) directly provide the monetary outcome and fairness norm, and the computed utility (U_accept) is used to determine the probability of accepting an offer (with stochasticity introduced later via a temperature parameter). Negative utility values will signal an unlikely acceptance.

Below is the formal model specification.

<MODEL>
U_accept = split_self - beta * max(((token_self/(token_self + token_opp)) * combined_earning) - split_self, 0)
</MODEL>

